import { ADD_TODO, DELETE_TODO} from "./todoTypes"

export const addTodo=(newToDo)=>{
    return{
        type:ADD_TODO,
        payload:newToDo

    }
}

export const deleteTodo=(todoListID)=>{
    return{
        type:DELETE_TODO,
        payload:todoListID

    }
}
